import w13 from "../assets/w13.jpg";
import w14 from "../assets/w14.jpg";
import w15 from "../assets/w15.jpg";
import w16 from "../assets/w16.jpg";
import w17 from "../assets/w17.jpg";

const Workout = () => {
  return (
    <>
    <Container>
        <strong>Chest Exercises</strong>
    <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        <Card className="my-3 p-3 rounded">
    <Card.Img src={w1} variant="top" />
    <Card.Body>
            <Card.Title as="div">
              <strong>Incline Chest Press</strong>
            </Card.Title>
          </Card.Body>
        </Card>
        </Container>
        </>
  )
}

export default Workout
